    // Fonction des animations aléatoires
     const wiggleAnimations = useMemo(() => {
        const generateWiggle = (amplitude = 15, frequency = 1) => {
            const values = []
            for (let i = 0; i <= frequency; i++) {
                const random = (Math.random() - 0.5) * amplitude * 2
                values.push(random)
            }
            return values
        }
        
        return {
            small: generateWiggle(15, 1),
            medium : generateWiggle(25, 2),
            
        }
    }, []);
    
        //Fonction d'ecriture du texte 
          const [displayText, setDisplayText] = useState('');
